'use strict';
//@@DocInclude
//@@DocBrief("The class with all unit types of time frames")
class TimeframeUnit {
    static get Unknown() { return 0; }
    static get Minute() { return 1; }
    static get Hour() { return 2; }
    static get Day() { return 3; }
    static get Week() { return 4; }
    static get Month() { return 5; }
    static get Year() { return 6; }
    static get Tick() { return 7; }
    static toString(unit) {
        if (unit == TimeframeUnit.Minute) {
            return "m";
        }
        if (unit == TimeframeUnit.Hour) {
            return "h";
        }
        if (unit == TimeframeUnit.Day) {
            return "d";
        }
        if (unit == TimeframeUnit.Week) {
            return "w";
        }
        if (unit == TimeframeUnit.Month) {
            return "M";
        }
        if (unit == TimeframeUnit.Year) {
            return "y";
        }
        if (unit == TimeframeUnit.Tick) {
            return "t";
        }
        return "unknown";
    }
    static fromString(unit) {
        if (unit == "m") {
            return TimeframeUnit.Minute;
        }
        if (unit == "h") {
            return TimeframeUnit.Hour;
        }
        if (unit == "d") {
            return TimeframeUnit.Day;
        }
        if (unit == "w") {
            return TimeframeUnit.Week;
        }
        if (unit == "M") {
            return TimeframeUnit.Month;
        }
        if (unit == "y") {
            return TimeframeUnit.Year;
        }
        if (unit == "t") {
            return TimeframeUnit.Tick;
        }
        return -1;
    }
}
module.exports = TimeframeUnit
